import './AddingForm.css';

const AddingForm = (props) => {
	const submitHandler = (event) => {
		event.preventDefault();
		props.Change();
	};

	return (
		<form onSubmit={submitHandler}>
			<div className='new-expense__controls'>
				<div className='new-expense__control'>
					<label>Szacunkowa liczba kilometrów do przejechania</label>
					<input type='number' step='0.1' />
				</div>
				<div className='new-expense__control'>
					<label>Rok wydania prawa jazdy</label>
					<input type='number' step='1' />
				</div>
				<div className='new-expense__control'>
					<label>Date wypożycznia samochodu</label>
					<input type='date' />
				</div>
				<div className='new-expense__control'>
					<label>Date oddania samochodu</label>
					<input type='date' />
				</div>
				<div className='new-expense__control'>
					<label>Kategoria cenowa samochodu</label>
					<select>
					<option value='0' disabled>Wybierz kategorie</option>
					<option value='1'>2022</option>
					<option value='1.3'>2021</option>
					<option value='1.6'>2020</option>
					<option value='2'>2019</option>
				</select>
				</div>
			</div>
			<div className='new-expense__actions'>
				<button type='submit'>Add Expense</button>
			</div>
		</form>
	);
};

export default AddingForm;
